import React from 'react';

class InfoSection extends Component {
	constructor() {
		super()
		this.state = {
			infos: "test"
		}
	}
	render(props) {
		return (
			<div className="info-section">
				<h2>{props.title}</h2>
				<p>{props.text}</p>
			</div>
		);
	}
}

export default InfoSection;
